import React from 'react';
import Tracker from './Tracker';

import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";


function App() {


  return (
    <div>
      <BrowserRouter>
        <Routes>
            <Route path="/" exact element={ <Tracker/> } />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
